(1, '進撃の巨人', 'Shingeki no Kyojin', 'L\'Attaque des Titans', 1, 'Wit Studio', 'Action, Drama, Fantasy, Mystery', 'Dans un monde ravagé par des titans mangeurs d’homme depuis plus d’un siècle, les rares survivants de l’Humanité n’ont d’autre choix pour survivre que de se barricader dans une cité-forteresse. Le jeune Eren, témoin de la mort de sa mère dévorée par un titan, n’a qu’un rêve : entrer dans le corps d’élite chargé de découvrir l’origine des titans, et les annihiler jusqu’au dernier…', 25, 0, , '2022-05-16', 2);
