(2, '進撃の巨人 2', 'Shingeki no Kyojin 2', 'L\'Attaque des Titans S2', 1, 'Wit Studio', 'Action, Drama, Fantasy, Mystery', 'Saison 2 de Shingeki no Kyojin<br>Suite aux événements impliquant Annie et Eren, tous les membres de leur promotion sont suspectés de pouvoir se transformer en Titan et sont isolés. Mais, pendant l’enquête, une nouvelle terrifiante parvient à la capitale : le mur de Rose serait fracturé.', 12, 0, , '2022-05-16', 2);
