(3, '進撃の巨人 3', 'Shingeki no Kyojin 3', 'L\'Attaque des Titans S3', 1, 'Wit Studio', 'Action, Drama, Fantasy, Mystery', 'Saison 3 de Shingeki no Kyojin<br>Le bataillon a réussi à récupérer Eren, mais le titan colossal et le titan cuirassé sont parvenus à leur échapper. De plus, les pertes sont colossales et Erwin doit faire face à de nouvelles accusations.', 22, 0, , '2022-05-16', 2);
