(5, '美少女戦士セーラームーン ', ' Bishoujo Senshi Sailor Moon', ' Sailor Moon ', 1, 'Toei Animation', 'Action, Fantasy, Mahou Shoujo, Romance', 'Usagi Tsukino est une adolescente tout ce qu’il y a de plus banale, paresseuse, nulle à l’école, gourmande et fan de jeux videos. Un jour, elle aide une chatte maltraitée par des enfants et la retrouve le soir-même dans sa chambre.Usagi n’est pas au bout de ses surprises puisque la chatte se met à parler et se présente sous le nom de Luna. Elle donne à Usagi un bâton lui permettant de se transformer en Sailor Moon afin de sauver le monde des forces du mal. Elle va vite être rejointe par Sailor V', 46, 0, , '2022-05-16', 2);
INSERT INTO `animes` (`id_anime`, `titre_native`, `titre_romaji`, `titre_fr`, `status`, `studio`, `genre`, `synopsis`, `nb_episodes`, `note`, `jaquette`, `dateCreation`, `createur`) VALUES
(6, 'ドラゴンボールZ', ' Dragon Ball Z ', ' Dragon Ball Z ', 1, ' Toei Animation ', ' Action, Adventure, Comedy', '  Dragon Ball Z reprend l’histoire de Sangoku plusieurs années après son mariage avec Chichi. Le couple a un fils nommé Sangohan en hommage à son arrière grand-père du même nom.  Un jour, Raditz atterrit sur la Terre et déclare qu’il est le frère de Sangoku. Il appartient au peuple des Sayajins, des guerriers intersidéraux mettant l’univers à feu et à sang. Leur planète, la planète Vegeta, a été détruite et il ne reste plus que quatre Sayajins purs : Sangoku, Raditz et ses complices partis en mi', 291, 0, , '2022-05-16', 4);
